import Link from "next/link";
import fetch from "isomorphic-unfetch";

const Index = () => {
    return(
        <div>
            <h1>Batman TV Shows</h1>
            <ul>
            {props.shows.map(show => (
                <li key={show.id}>
                <Link href="/shows/[id]" as={`/shows/${show.id}`}>
                    <a>{show.name}</a>
                </Link>
                </li>
            ))}
            </ul>
        </div>
    )
};
export default Index;
